    public static void empty(String string, int range, int x, int y){
        if(string.equals("War")){
            for(int i = x - range + 1; i <= x + range - 1; i++){
                for(int j = y - range + 1; j <= y + range - 1; j++){
                    War[i][j] = false;
                }
            }
        }

        if(string.equals("Shop")){
            for(int i = x - range + 1; i <= x + range - 1; i++){
                for(int j = y - range + 1; j <= y + range - 1; j++){
                    Shop[i][j] = false;
                }
            }

        }

        if(string.equals("isNotPassAble")){
            for(int i = x - range + 1; i <= x + range - 1; i++){
                for(int j = y - range + 1; j <= y + range - 1; j++){
                    IsNotPassAble[i][j] = false;
                }
            }

        }
    }

